Handlebar helper showing the same date for every post<p>So I have a site where users can make posts and I want the date at which they made it to be displayed on the post. To do this I am using momentjs and a handlebar helper.</p>
<p>helpers/hbs.js</p>
<pre><code> formatDate: function (date, format) {
    return moment(date).format(format);
  },
</code></pre>
<p>and my handlebar <code>{{{formatDate date 'MMMM Do YYYY, h:mm a'}}}</code></p>
<p>Just to note I have already registered the handlebar helper</p>
<pre><code>const { formatDate, ifCond } = require('./helpers/hbs');
app.engine(
  '.hbs',
  exphbs({
    helpers: { formatDate, ifCond },
    defualtLayout: 'main',
    extname: '.hbs',
  })
);
</code></pre>
<p>The problem is that it is showing the same date for every post. When I put the mongoose createdAt, it displays the correct date for each post but in a unformatted way. I've been looking for solutions and still can't find one.</p>

